    false,nt"url": null,nt"notes": "This data set provides information about
    wells that are certified by the State of Missouri. The parent data set is the Wellhead
    Information Management System (WIMS) database that is maintained by the Missouri
    Department of Natural Resources (DNR), Division of Geology and Land Survey (DGLS),
    Geological Survey Program (GSP), Wellhead Protection Section (WHP). The WIMS database
    resulted from implementation of the Water Well Drillers Law of 1985. The information
    about well location, well ownership, well completion date, well construction, well
    yield, static water level, and borehole stratigraphy was provided by well drillers
    as required by state statute RSMo 256.600-256.640. Wells drilled prior to July of
    1987 are not included in this data set. A new WIMS Well Search is also available
    online at http://dnr.mo.gov/mowells/publicLanding.do",nt"license_title": null,nt"extras":
